import React from 'react';
import './ResumeDetails.css';

const ResumeDetails = ({ analysis }) => {
  if (!analysis || !analysis.analysis) return null;

  const { resume, analysis: details } = analysis;

  const getRatingColor = (rating) => {
    if (rating >= 8) return '#4caf50';
    if (rating >= 6) return '#ff9800';
    return '#f44336';
  };

  return (
    <div className="resume-details">
      <h2>Analysis Results</h2>
      
      <div className="details-grid">
        <div className="detail-card">
          <h3>Personal Information</h3>
          <div className="info-item">
            <strong>Name:</strong> {details.name || 'Not found'}
          </div>
          <div className="info-item">
            <strong>Email:</strong> {details.email || 'Not found'}
          </div>
          <div className="info-item">
            <strong>Phone:</strong> {details.phone || 'Not found'}
          </div>
        </div>

        <div className="detail-card">
          <h3>Resume Rating</h3>
          <div className="rating-display">
            <div 
              className="rating-circle"
              style={{ borderColor: getRatingColor(details.rating) }}
            >
              <span className="rating-number">{details.rating}/10</span>
            </div>
            <p className="rating-text">
              {details.rating >= 8 ? 'Excellent' : 
               details.rating >= 6 ? 'Good' : 'Needs Improvement'}
            </p>
          </div>
        </div>
      </div>

      {details.summary && (
        <div className="detail-card">
          <h3>Professional Summary</h3>
          <p>{details.summary}</p>
        </div>
      )}

      {details.skills && details.skills.length > 0 && (
        <div className="detail-card">
          <h3>Skills</h3>
          <div className="skills-container">
            {details.skills.map((skill, index) => (
              <span key={index} className="skill-tag">{skill}</span>
            ))}
          </div>
        </div>
      )}

      {details.experience && details.experience.length > 0 && (
        <div className="detail-card">
          <h3>Experience</h3>
          {details.experience.map((exp, index) => (
            <div key={index} className="experience-item">
              <h4>{exp.position}</h4>
              <p className="company">{exp.company} • {exp.duration}</p>
              <p className="description">{exp.description}</p>
            </div>
          ))}
        </div>
      )}

      {details.education && details.education.length > 0 && (
        <div className="detail-card">
          <h3>Education</h3>
          {details.education.map((edu, index) => (
            <div key={index} className="education-item">
              <h4>{edu.degree} in {edu.field}</h4>
              <p>{edu.institution} • {edu.year}</p>
            </div>
          ))}
        </div>
      )}

      {details.suggestions && details.suggestions.length > 0 && (
        <div className="detail-card suggestions">
          <h3>💡 Suggestions</h3>
          <ul>
            {details.suggestions.map((suggestion, index) => (
              <li key={index}>{suggestion}</li>
            ))}
          </ul>
        </div>
      )}

      {details.improvements && details.improvements.length > 0 && (
        <div className="detail-card improvements">
          <h3>🎯 Areas for Improvement</h3>
          <ul>
            {details.improvements.map((improvement, index) => (
              <li key={index}>{improvement}</li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default ResumeDetails;
